import Layout from "../../components/Layout"
import { useRouter } from 'next/router'
import posts from '../../static/topic.json'

const OtherTopic = (props) => {
    const otherTopics = props.posts.filter(post => post.postName != props.currPostName);
    return (
        <div>
            {
                otherTopics.map(topic => (
                    <h1>This is topic {topic.name}</h1>
                ))
            }
        </div>
    );
}

const Post = () => {
    const router = useRouter();
    const currPostName = router.query.postName;

    // how do I get the name of this link name?
    return (
        <Layout>
            <OtherTopic posts={posts} currLinkName={currPostName}/>
        </Layout>
    );
}
export default Post;
